import React from 'react';
import '../../App.css';


export default function SignUp() {
  return <h1 className='sign-up'></h1>;

}
const Signup = () =>{
  return (
    <>
     <section className="signup">
      <div className="container mt-5">
      <div className="signup-content">
</div>
</div>
</section>
    </>
  )
}
